  `HOPE_CUSTOMERS_COUNT` varchar(255) DEFAULT NULL COMMENT '预计客户数',
  `HOPE_COST_AMOUNT` varchar(255) DEFAULT NULL COMMENT '预计成本',
  `ACTUAL_COST_AMOUNT` varchar(255) DEFAULT NULL COMMENT '实际成本',
