  `REC_AMOUNT` varchar(255) DEFAULT NULL COMMENT '个数',
  `MAA_CODE` varchar(255) DEFAULT NULL COMMENT '市场活动编码',
  `TEACHER_ID` varchar(255) DEFAULT NULL COMMENT '讲师id',
  `COMBO_ID` varchar(255) DEFAULT NULL COMMENT '套餐id',
  `MAA_TYPE_FLAG` varchar(255) DEFAULT NULL COMMENT '活动方式标示：P代表产品、C代表套餐',
  PRIMARY KEY (`ACTIVITY_ALL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

