  `CUS_CITY` varchar(255) DEFAULT NULL COMMENT '城市',
  `CUS_COUNTY` varchar(255) DEFAULT NULL COMMENT '区县',
  `CUS_BUSINESS_ADDRESS` varchar(255) DEFAULT NULL COMMENT '办公地址',
  `CUS_FAX` varchar(255) DEFAULT NULL COMMENT '传真',
