  `LAST_UPDATED_BY` varchar(255) DEFAULT NULL COMMENT '最后更新人',
  `EDUCATION_ID` varchar(255) DEFAULT NULL COMMENT '教育程度',
  `CUSTOMER_NUMBER` varchar(255) DEFAULT NULL COMMENT '会员上课期号',
  `CUSTOMER_LEVEL` varchar(255) DEFAULT NULL COMMENT '会员等级',
  `CUS_ID_CARD` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `CUS_nation` varchar(255) DEFAULT NULL COMMENT '民族',
  `CUS_YEAR` varchar(255) DEFAULT NULL COMMENT '出生年月日（年.月.日）',
