/*Table structure for table `member_order` */

DROP TABLE IF EXISTS `member_order`;

CREATE TABLE `member_order` (
  `ORDER_ID` varchar(100) NOT NULL,
  `OFA_DATE` varchar(255) DEFAULT NULL COMMENT '订单日期',
  `OFA_CODE` varchar(255) DEFAULT NULL COMMENT '订单编号',
  `TRX_ORGANIZATION_ID` varchar(255) DEFAULT NULL COMMENT '组织id',
  `FIN_ORGANIZATION_ID` varchar(255) DEFAULT NULL COMMENT '公司id',
  `OFT_TYPE_ID` varchar(255) DEFAULT NULL COMMENT '订单类型',
  `OFA_CUSTOMER_ID` varchar(255) DEFAULT NULL COMMENT '客户',
  `MONEY_COUSOMER_ID` varchar(255) DEFAULT NULL COMMENT '缴费人',
  `OFA_ITEM_ID` varchar(255) DEFAULT NULL COMMENT '成交产品',
  `ITEM_PRICE` varchar(255) DEFAULT NULL COMMENT '产品价格',
  `FOR_SALE_RATE` varchar(255) DEFAULT NULL COMMENT '折扣率',
  `OFA_QUANTITY` varchar(255) DEFAULT NULL COMMENT '成交数量',
  `OFA_PRICE` varchar(255) DEFAULT NULL COMMENT '成交单价(元)',
  `OFA_SUM_AMOUNT` varchar(255) DEFAULT NULL COMMENT '成交金额',
  `REAL_TYPE` varchar(255) DEFAULT NULL COMMENT '缴款方式',
  `REAL_DATE` varchar(255) DEFAULT NULL COMMENT '缴款日期',
  `OFA_AMOUNT` varchar(255) DEFAULT NULL COMMENT '缴款金额',
  `OFA_USE_PERIOD` varchar(255) DEFAULT NULL COMMENT '有效期',
  `STATUS` varchar(255) DEFAULT NULL COMMENT '状态',
  `NOTE` varchar(255) DEFAULT NULL COMMENT '备注',
  `CREATION_DATE` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `CREATED_BY` varchar(255) DEFAULT NULL COMMENT '创建人',
  `LAST_UPDATED_DATE` varchar(255) DEFAULT NULL COMMENT '最后更新时间',
  `LAST_UPDATED_BY` varchar(255) DEFAULT NULL COMMENT '最后更新人',
  `TK_DATE` varchar(255) DEFAULT NULL COMMENT '退款日期',
  `ISDELETE` varchar(255) DEFAULT NULL COMMENT '是否删除',
  `OFA_POS` varchar(255) DEFAULT NULL COMMENT '票据号',
  PRIMARY KEY (`ORDER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `member_order` */

/*Table structure for table `sys_app_user` */

DROP TABLE IF EXISTS `sys_app_user`;

CREATE TABLE `sys_app_user` (
  `USER_ID` varchar(100) NOT NULL,
  `USERNAME` varchar(255) DEFAULT NULL,
  `PASSWORD` varchar(255) DEFAULT NULL,
  `NAME` varchar(255) DEFAULT NULL,
  `RIGHTS` varchar(255) DEFAULT NULL,
  `ROLE_ID` varchar(100) DEFAULT NULL,
  `LAST_LOGIN` varchar(255) DEFAULT NULL,
  `IP` varchar(100) DEFAULT NULL,
  `STATUS` varchar(32) DEFAULT NULL,
  `BZ` varchar(255) DEFAULT NULL,
  `PHONE` varchar(100) DEFAULT NULL,
  `SFID` varchar(100) DEFAULT NULL,
  `START_TIME` varchar(100) DEFAULT NULL,
  `END_TIME` varchar(100) DEFAULT NULL,
  `YEARS` int(10) DEFAULT NULL,
  `NUMBER` varchar(100) DEFAULT NULL,
  `EMAIL` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

