/*Table structure for table `sys_sendmssages` */

DROP TABLE IF EXISTS `sys_sendmssages`;

CREATE TABLE `sys_sendmssages` (
  `SENDMSSAGES_ID` int(100) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) DEFAULT NULL COMMENT '用户姓名',
  `PHONE` varchar(255) DEFAULT NULL COMMENT '手机号',
