  `ERRORNOTE` varchar(3000) DEFAULT NULL COMMENT '错误标示',
  PRIMARY KEY (`SENDMSSAGES_ID`,`ISSEND`)
) ENGINE=InnoDB AUTO_INCREMENT=100410 DEFAULT CHARSET=utf8;

