/*Table structure for table `tb_sign` */

DROP TABLE IF EXISTS `tb_sign`;

CREATE TABLE `tb_sign` (
  `S_ID` varchar(100) NOT NULL,
  `USERNAME` varchar(255) DEFAULT NULL COMMENT '客户姓名',
  `USERALIAS` varchar(255) DEFAULT NULL COMMENT '客户别名',
  `PHONE` varchar(255) DEFAULT NULL COMMENT '手机号',
  `USERPHONE` varchar(255) DEFAULT NULL COMMENT '客户手机号',
  `SIGNTIME` varchar(255) DEFAULT NULL COMMENT '签到时间',
  `ISENROLL` varchar(255) DEFAULT NULL COMMENT '是否报名',
  `ISSIGN` varchar(255) DEFAULT NULL COMMENT '是否签到',
  `ID_CARD` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `nation` varchar(255) DEFAULT NULL COMMENT '民族',
  `YEAR` varchar(255) DEFAULT NULL COMMENT '出生年月日（年.月.日）',
  `JFJG` varchar(255) DEFAULT NULL COMMENT '签发机关',
  `Validity_Period` varchar(255) DEFAULT NULL COMMENT '有效期限',
  `HOME_ADDRESS` varchar(255) DEFAULT NULL COMMENT '家庭地址',
  `SEX` varchar(255) DEFAULT NULL COMMENT '性别',
  `frequency` varchar(255) DEFAULT NULL COMMENT '会员上课次数',
  `JF` varchar(255) DEFAULT NULL COMMENT '积分',
  `LEVEL` varchar(255) DEFAULT NULL COMMENT '会员等级',
  `OTHER` varchar(255) DEFAULT NULL COMMENT '备注',
  `ORGANIZATION` varchar(255) DEFAULT NULL COMMENT '所属公司',
  PRIMARY KEY (`S_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

